    [],nt"revision_timestamp": "2015-09-04T07:28:37.215220",nt"name": "medicare-and-medicaid-linked-files",nt"isopen":
    false,nt"url": null,nt"notes": "<p>The Medicare-Medicaid Linked Enrollee
    Analytic Data Source (MMLEADS) has been developed to allow for the examination of
    all Medicare and Medicaid enrollment and claims data for those who were dually enrolled
    in both programs. The current files are intended for both CMS and external researcher
    use. They are primarily designed to address questions regarding eligibility, enrollment,
    cost, use, and select physical and mental health conditions. This comprehensive
    suite of annual, calendar year data files contains Medicare Beneficiary Files, Medicaid
    Beneficiary Files, Medicare Service Files, Medicaid Service Files, and Conditions
    Files.</p>n",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
